  input: TEXT,F3XA,,"This amendment responds to your letter of December 22, 2004.
    We did not disclose any salary or wage or associated payments on Schedule B for
    line 30b because no employee spent more than 25% of his or her compensated time
    in the month on Federal Eelction Activity or activity in connection with a federal
    election. Following our amendment of the January 31 Year End report, we have removed
    all salaries from Schedule H4 and have disclosed the salaries and taxes on Schedule
    B for Line 21b. These employees should have been paid nonfederally; they were
    not FEA. We have provided a breakdown of the transfer on Schedule H3. We have
    clarified the purposes of itemized disbursements. In reviewing Schedule H4, we
    determined that disbursements for a party fundraising event had been incorrectly
    reported and allocated. We have created a unique identifier and allocation ratio
    for the event on H2, and have reported and allocated the expenses for this event
    correctly.  In addition in reveiwing our records we found that a number of unitemized
    contributions were inadvertantly admitted from the original report."
